(109, 'Banyak orang yang harus menghadapi berbagai rasa kehilangan di tahun lalu karena COVID-19.\r\n\r\nMenyediakan waktu untuk memproses pikiran dan perasaan kita dapat membantu memberikan perspektif, rasa tenang, dan penerimaan akan situasi tersebut\r\n\r\n#kesehatanjiwa #mentalhealth https://t.co/s2GGPJ126f', 'true', 1, NULL, '2021-07-10 05:50:54'),
(110, 'Pandemi COVID-19 membuat jutaan pengguna tembakau mengatakan mereka ingin berhenti. Ayo bergabung bersama jutaan orang untuk berhenti menggunakan tembakau JENIS APA PUN mulai hari ini.', 'true', 1, NULL, '2021-07-10 05:50:55'),
(111, 'Sudah divaksinasi atau belum, Anda tetap harus waspada dan membantu melindungi orang-orang lain di sekitar kita ya. Tetap kenakan masker dan ikuti semua tindakan pencegahan COVID-19! \r\n\r\n https://t.co/EfGA0FKKSQ', 'true', 1, NULL, '2021-07-10 05:50:56'),
(112, 'COVID-19 telah menunjukkan betapa pentingnya sistem kesehatan yang kuat. Untuk mencapai cakupan kesehatan semesta, perlu adanya komitmen bersama utk solidaritas, kesetaraan &amp; keberlanjutan.\r\n\r\nPesan Sekjen PBB pada World Health Assembly #WHA74: https://t.co/FU0YEkuFCe\r\n\r\n#WeeklyRecap https://t.co/0tcss1bmRW', 'true', 1, NULL, '2021-07-10 05:50:57'),
(113, 'Meskipun sedang libur, jangan lupa untuk tetap menerapkan tindakan-tindakan pencegahan COVID-19 ya! https://t.co/HKy6e6auBy', 'true', 1, NULL, '2021-07-10 05:50:58'),
(114, 'Jika Anda sudah diberikan kesempatan untuk mendapatkan vaksin COVID-19, segera divaksinasi ya, jangan ragu-ragu. Dan setelah divaksinasi, tetap terapkan semua tindakan pencegahan. https://t.co/dmjZuUpDgn', 'true', 1, NULL, '2021-07-10 05:50:59'),
(115, 'Selalu terapkan semua tindakan pencegahan #COVID19 karena bisa saja Anda sedang sakit, tetapi tidak menunjukkan gejala. Dan jika Anda memang sedang merasa kurang sehat, #dirumahaja dan hindari bertemu orang lain ya! https://t.co/wf9mbsS6j8', 'true', 1, NULL, '2021-07-10 05:51:00'),
(116, 'Liburan kali ini Anda masih tetap harus berhati-hati karena #COVID19 masih tetap ada. Jadi tetap ikuti anjuran pemerintah, jaga kesehatan, dan lakukan semua tindakan pencegahan untuk melindungi diri sendiri dan orang-orang di sekitar Anda. \r\n\r\nJangan lengah ya https://t.co/5cA166RQwJ', 'true', 1, NULL, '2021-07-10 05:51:01'),
(117, 'Selamat Idulfitri! \r\n\r\nJangan lupa untuk tetap waspada dan lakukan semua tindakan pencegahan #COVID19. Stay safe and healthy, ya. https://t.co/bZfmKdUvK2', 'true', 1, NULL, '2021-07-10 05:51:03'),
(118, 'Musim liburan kali ini, pastikan Anda tetap mengikuti protokol kesehatan dan peraturan pemerintah. Ingat, #COVID19 masih tetap ada. \r\n\r\nJadi nikmati waktu yang berkualitas #dirumahaja dan lakukan pertemuan dengan teman-teman dan keluarga besar secara virtual ya!  https://t.co/FRegkOLayw', 'true', 1, NULL, '2021-07-10 05:51:04'),
(119, 'Selama pandemi #COVID19 ini, sangatlah penting untuk menghindari tempat-tempat yang ramai maupun ruangan tertutup dengan ventilasi yang kurang memadai, dan membatasi waktu Anda di tempat umum. Jadi, sebisa mungkin usahakan untuk berbelanja secara online saja ya! https://t.co/pyDlhdbd2c', 'true', 1, NULL, '2021-07-10 05:51:05'),
(120, 'Sudah divaksinasi?\r\nTapi jangan lupa ya, meskipun sudah divaksinasi, ini BUKAN alasan untuk lengah dan mengurangi kewaspadaan. Tetap ikuti protokol kesehatan dan bantu lindungi orang-orang lain karena #COVID19 masih ada. https://t.co/TzFqeov2Jh', 'true', 1, NULL, '2021-07-10 05:51:06'),
(121, '#WeeklyRecap\r\n\r\nKebiasaan membersihkan tangan dapat mencegah penyebaran infeksi, #COVID19, dan penyakit-penyakit lainnya. Beberapa detik dapat selamatkan nyawa  ayo bersihkan tangan Anda!  https://t.co/O3rPGlnAZ6 https://t.co/x5ROC80lYk', 'true', 1, NULL, '2021-07-10 05:51:07'),
(122, '#WorldHandHygieneDay!\r\n\r\nSemua orang memiliki peranan untuk mencegah penyebaran infeksi. Ayo berpartisipasi dalam upaya global untuk memastikan kebersihan tangan #handhygiene guna mencegah #COVID19 &amp; penyakit-penyakit lainnya!\r\n\r\n#CleanYourHands\r\n#InfectionPrevention https://t.co/lZeZcubR66', 'true', 1, NULL, '2021-07-10 05:51:07'),
(123, 'Selalu kenakan masker yang pas dengan tepat. Tak hanya ketika berada di luar, tetapi juga di dalam ruangan yang tidak memiliki ventilasi memadai. \r\n\r\nTetap waspada akan #COVID19! https://t.co/jMcy8GKTz2', 'true', 1, NULL, '2021-07-10 05:51:08'),
(124, '#WeeklyRecap\r\n\r\n#COVID19 menunjukkan betapa rentannya kita tanpa multilateralisme &amp; diplomasi. Mari bersatu untuk mengatasi pandemi &amp; pastikan tidak ada yang tertinggal.\r\n\r\nPesan Sekjen PBB di Hari Multilateralisme &amp; Diplomasi Internasional untuk Perdamaian: https://t.co/ZoivdkA2E5 https://t.co/OOKo6BHuHH', 'true', 1, NULL, '2021-07-10 05:51:09'),
(125, 'Ramadan kali ini kita masih tetap menghadapi pandemi #COVID19. Jadi jangan lengah ya dan tetap terapkan semua tindakan pencegahan  mulai dari menjaga jarak fisik hingga memakai masker yang pas dengan tepat.\r\n\r\nTetap semangat, stay safe and healthy yahttps://t.co/7kwOtHmqRa', 'true', 1, NULL, '2021-07-10 05:51:11'),
(126, 'Seminar virtual Taking care of the elderly during COVID-19 pandemic akan menghadirkan Menteri Kesehatan Republik #Indonesia, Bapak Budi Gunadi, dan beberapa ahli (termasuk di antaranya dr Olivi Silalahi, https://t.co/pbwNNmhCdg dari #WHOIndonesia).\r\n\r\nhttps://t.co/lOx3Yv4vtA https://t.co/ztLB486Cyf', 'true', 1, NULL, '2021-07-10 05:51:13'),
(127, 'Dapatkan informasi seputar aktivitas &amp; upaya kami dalam penanganan #COVID19 selama 1 bulan terakhir. \r\n\r\nBaca dan unduh Ikhtisar Kegiatan #WHOIndonesia edisi ke-11 di https://t.co/kYTa0k4lU9! https://t.co/1SABXHL2OI', 'true', 1, NULL, '2021-07-10 05:51:14'),
(128, 'Bukber di bulan Ramadan? Lakukan saja secara virtual ya atau nikmati acara berbuka bersama hanya dengan orang-orang yang tinggal serumah dengan Anda. \r\n\r\nJangan lupa terapkan semua tindakan pencegahan #COVID19 ya! https://t.co/09I6pdynpy', 'true', 1, NULL, '2021-07-10 05:51:15'),
(129, 'Pandemi #COVID19 adalah tantangan kita yg paling mendesak. Tetapi kita tidak bisa mengabaikan ketidaksetaraan lainnya yg makin buruk akibat pandemi ini.\r\n\r\nPesan Sekjen PBB di Forum Dewan Ekonomi dan Sosial tentang Pembiayaan untuk Pembangunan: https://t.co/fkYpPF4LiW\r\n\r\n#WeeklyRecap https://t.co/fvgUlgbmpr', 'true', 1, NULL, '2021-07-10 05:51:16'),
(130, 'Anda harus beraktivitas di luar rumah hari ini? Jangan lupa terapkan tindakan-tindakan pencegahan #COVID19 ya. Salah satunya adalah dengan memakai masker yang pas dengan tepat. Apa saja yang harus diperhatikan? Simak video berikut ini! https://t.co/aLe7c6u5BH', 'true', 1, NULL, '2021-07-10 05:51:16'),
(131, 'Selamat pagi! Aktivitas fisik yang dijalankan secara rutin baik untuk #kesehatanjiwa dan tubuh Anda, lho. Jadi, yuk lakukan berbagai aktivitas fisik (berolahraga, beres-beres rumah, berkebun, dll) sambil tetap mengikuti protokol kesehatan agar terlindung dari #COVID19. https://t.co/34S04Lw9wM', 'true', 1, NULL, '2021-07-10 05:51:17'),
(132, '#IkhtisarMingguan: edisi #WorldHealthDay\r\n\r\nPandemi #COVID19 menyoroti bagaimana kondisi kehidupan seseorang memengaruhi akses mereka ke layanan kesehatan.\r\n\r\nDi Hari Kesehatan Sedunia &amp; setiap harinya, mari membangun yang lebih adil &amp; lebih sehat bagi semua orang! #HealthForAll https://t.co/0goo65Xzm5', 'true', 1, NULL, '2021-07-10 05:51:18'),
(133, '#HariKesehatanSedunia #WorldHealthDay\r\n\r\nPandemi #COVID19 telah mengajarkan kita bahwa tidak ada seorang pun yang terlindungi hingga semua orang terlindungi. Pastikan vaksin, tes, dan pengobatan dapat dijangkau oleh semua orang, tanpa terkecuali. \r\n\r\n#HealthforAll https://t.co/piOB7H7I69', 'true', 1, NULL, '2021-07-10 05:51:19'),
(134, 'Beberapa varian baru virus #COVID19 tampaknya lebih mudah menyebar. Tetapi kita masih dapat mencegah penyebarannya. Jadi tetap lakukan semua tindakan pencegahan ya! https://t.co/IkzqnZY7ZZ', 'true', 1, NULL, '2021-07-10 05:51:20'),
(135, 'Anda berperan penting dalam membantu melindungi orang-orang lain dan menekan penyebaran #COVID19 di #Indonesia. Lakukan semua tindakan pencegahan dan berpartisipasilah dalam pelacakan kontak. Ikuti petunjuk petugas dan berikan informasi lengkap untuk memudahkan proses pelacakan. https://t.co/ZD2yQpNTun', 'true', 1, NULL, '2021-07-10 05:51:21'),
(136, '#WeeklyRecap hadir kembali.\r\n \r\nKrisis #COVID19 menggarisbawahi kebutuhan mendesak untuk investasi dalam sistem kesehatan, bertindak tegas dan dengan cepat untuk mencegah dekade yang hilang untuk pembangunan.\r\n \r\nBaca laporan #Fin4Dev kami: https://t.co/dM6rVpIcF8 https://t.co/bE6fhVHIgx', 'true', 1, NULL, '2021-07-10 05:51:22'),
(137, 'Di masa pandemi #COVID19 ini, usahakan untuk saling membantu dan mendukung orang-orang di sekitar kita ya. Ini juga dapat membantu kita dalam menghadapi tekanan selama pandemi dan menjaga #kesehatanjiwa.\r\n\r\nTetap semangat, were #inthistogether! https://t.co/vvK0TlzNMP', 'true', 1, NULL, '2021-07-10 05:51:23'),
(138, 'Sudah waktunya belanja bulanan? Perhatikan hal-hal berikut ini sebelum  berbelanja. Dan jangan lupa untuk tetap menerapkan tindakan-tindakan pencegahan saat berbelanja untuk melindungi diri Anda dari #COVID19. https://t.co/kEaPphQiDE', 'true', 1, NULL, '2021-07-10 05:51:24'),
(139, '#WorldTBDay2021: The clock is ticking. Meskipun kita sedang menghadapi pandemi #COVID19, kita tetap harus meneruskan perlawanan terhadap #TBC di #Indonesia. Saatnya bagi semua pihak untuk lebih serius dalam menjalankan komitmen demi #EndTB. https://t.co/hc8T8t4Cmu', 'true', 1, NULL, '2021-07-10 05:51:25'),
(140, 'Tetap jaga kebugaran tubuh dan kesehatan jiwa ya! Lakukan berbagai aktivitas fisik yang sesuai dengan kemampuan Anda dan pastikan untuk tetap mengikuti berbagai tindakan pencegahan #COVID19. https://t.co/LelNeiVYdS', 'true', 1, NULL, '2021-07-10 05:51:26'),
(141, 'Semua orang memerlukan dukungan ekstra selama pandemi ini. Tetap saling menyemangati, ya. Ayo kita lawan #COVID19 bersama-sama, di mana pun Anda berada! \r\n\r\nWere #inthistogether! https://t.co/osox711e2K', 'true', 1, NULL, '2021-07-10 05:51:27'),
(142, '#COVID19 menunjukkan seberapa dalam ketidaksetaraan gender di sekitar kita. Saatnya meninggalkan generasi diskriminasi yg mengakar &amp; sistemik. Saatnya membangun masa depan yg seimbang.\r\n\r\nPesan Sekjen PBB pada Komisi Status Perempuan ke-65: https://t.co/LEgvF9KAMB https://t.co/dN8nDQNjrj', 'true', 1, NULL, '2021-07-10 05:51:28'),
(143, 'Bahkan jika Anda muda dan sehat, Anda dapat tetap terinfeksi dan jatuh sakit karena #COVID19. Lindungi diri sendiri dan orang-orang lain dengan tetap menerapkan semua tindakan pencegahan ya! https://t.co/RmfGWHvHTc', 'true', 1, NULL, '2021-07-10 05:51:29'),
(144, 'Dr dr Helda adalah Kepala Studi Seroepidemiologi #COVID19 di Jakarta. Studi ini dilakukan untuk memahami bagaimana dan sampai di manakah virus SARS-CoV-2 telah menginfeksi populasi di #Indonesia. \r\n\r\nSelengkapnya: https://t.co/N6P4yf68U4\r\n\r\n#IWD2021 https://t.co/NUC5H0A3jz', 'true', 1, NULL, '2021-07-10 05:51:30'),
(145, 'Weekend #dirumahaja? Selain bersantai sambil menonton film serial dan acara-acara lainnya, sekalian yuk melihat berbagai video tentang #COVID19 di website kami: https://t.co/gicqotQFZY https://t.co/TwaVGgRMR1', 'true', 1, NULL, '2021-07-10 05:51:31'),
(146, 'Dr dr Vivi adalah Kepala Puslitbang Biomedis dan Teknologi Dasar Kesehatan. Beliau memimpin upaya pengembangan &amp; perluasan \r\njejaring laboratorium di Indonesia -- salah satu tugas penting dalam upaya penanganan pandemi #COVID19.\r\n\r\nSelengkapnya: https://t.co/KP6VBlqoBi\r\n\r\n#IWD2021 https://t.co/Qo3Ul2FGSm', 'true', 1, NULL, '2021-07-10 05:51:33'),
(147, 'WHO dan Uni Eropa umumkan kerja sama baru untuk mendukung respons COVID-19 dan memperkuat sistem kesehatan di Indonesia \r\nhttps://t.co/zYNNvqhgRZ https://t.co/6ofh5uZrBO', 'true', 1, NULL, '2021-07-10 05:51:34'),
(148, 'Di mana pun Anda berada, baik di rumah atau jika terpaksa harus beraktivitas di luar rumah, pastikan untuk selalu menerapkan etiket batuk dan bersin ya. Ini adalah salah satu kebiasaan baik selama pandemi #COVID19 yang dapat membantu melindungi orang-orang lain di sekitar Anda. https://t.co/NKLtYteCpQ', 'true', 1, NULL, '2021-07-10 05:51:35'),
(149, 'Ingat ya ... jika Anda sudah divaksinasi, pastikan Anda tetap menerapkan tindakan-tindakan pencegahan #COVID19!\r\n\r\nTetap waspada. Were #inthistogether! https://t.co/DaObsZ8lD9', 'true', 1, NULL, '2021-07-10 05:51:36'),
(150, 'Yuk bantu mengingatkan lansia di keluarga Anda untuk menjalankan gaya hidup sehat selama pandemi #COVID19! Pastikan mereka mengonsumsi makanan yang tak hanya lezat, tetapi juga sehat dan dalam jumlah yang tepat. https://t.co/mCDU2KIOcC', 'true', 1, NULL, '2021-07-10 05:51:36'),
(151, 'Jangan lupa untuk tetap menerapkan tindakan-tindakan pencegahan #COVID19 ya. Selamat beraktivitas! https://t.co/g9nkDsnbUm', 'true', 1, NULL, '2021-07-10 05:51:37'),
(152, 'Yuk bantu anak-anak  agar tetap bersemangat meskipun #dirumahaja selama pandemi #COVID19 ini! Rancang berbagai permainan kreatif dan seru yang dapat membantu mereka mengekspresikan perasaan mereka. https://t.co/9LBRT1pwIY', 'true', 1, NULL, '2021-07-10 05:51:38'),
(153, 'Meskipun selama pandemi #COVID19 kita mungkin tidak dapat bertemu dengan orang-orang terdekat, terutama mereka yang termasuk ke dalam kelompok rentan (lansia &amp; orang-orang dengan kondisi kesehatan tertentu), tetaplah rajin berkomunikasi dengan satu sama lain melalui  ya! https://t.co/l20oplHYVT', 'true', 1, NULL, '2021-07-10 05:51:39'),
(154, 'Jika Anda harus beraktivitas di luar rumah selama pandemi #COVID19 ini, pastikan untuk selalu menjaga jarak fisik dan menerapkan tindakan-tindakan pencegahan lainnya ya! https://t.co/BPj1xPM7UV', 'true', 1, NULL, '2021-07-10 05:51:40'),
(155, 'Kapan Anda harus memakai masker di dalam ruangan? Cek panduan dari kami berikut ini!\r\n\r\n#COVID19 \r\n#lawancovid19 https://t.co/npXVf6heVf', 'true', 1, NULL, '2021-07-10 05:51:40'),
(156, 'Ayo jaga #kesehatanjiwa di rumah dengan cara menikmati waktu yang berkualitas dengan orang-orang tercinta , menjalankan gaya hidup sehat tetap terhubung dengan satu sama lain terutama selama pandemi #COVID19. https://t.co/m8QqQLjeeV', 'true', 1, NULL, '2021-07-10 05:51:41'),
(157, 'Jika kamu memiliki anggota keluarga penyandang disabilitas, yuk bantu dan dampingi mereka untuk mendapatkan vaksinasi COVID-19 di faskes maupun sentra vaksinasi terdekat di kotamu ya #Healthies. \r\n\r\nSalam sehat!', 'true', 1, NULL, '2021-07-10 05:51:42'),
(158, 'Update situasi terkini perkembangan #COVID19 di Indonesia (6/6)\r\n\r\n#BersatuLawanCovid19 #dirumahaja#jagajarak #adaptasikebiasaanbaru https://t.co/uyxKfOEa35', 'true', 1, NULL, '2021-07-10 05:51:43'),
(159, '#Healthies, pada pelaksanaanya antara vaksinasi program pemerintah dan vaksinasi Gotong Royong berbeda, namun pada prinsipnya sama yakni meningkatkan cakupan program vaksinasi nasional COVID-19 untuk mempercepat tercapainya kekebalan kelompok.', 'true', 1, NULL, '2021-07-10 05:51:44'),
(160, 'Pelaksanaan vaksinasi program pemerintah dilakukan di faskes milik pemerintah ataupun pos pelayanan vaksinasi COVID-19, sedangkan vaksinasi Gotong Royong digelar si faskes milik masyarakat atau swasta yang telah memenuhi syarat.', 'true', 1, NULL, '2021-07-10 05:51:46'),
(161, 'Disampaikan bahwa hingga kini, @KemenkesRI belum membuka jalur vaksinasi mandiri COVID-19. Pemerintah hanya menyediakan 2 opsi yakni vaksinasi program pemerintah dan vaksinasi Gotong Royong.', 'true', 1, NULL, '2021-07-10 05:51:47'),
(162, '#Healthies, belakangan menyeruak kabar bahwa sejumlah rumah sakit telah membuka pendaftaran vaksinasi COVID-19 jalur mandiri/perorangan dengan membayar sejumlah nominal tertentu. https://t.co/rsTOx2cedB', 'true', 1, NULL, '2021-07-10 05:51:47'),
(163, 'Tunggu apa lagi? Ayok kita segera lindungi orang orang terdekat kita dari kemungkinan terinfeksi COVID-19. Semakin cepat  divaksinasi, semakin cepat pula mereka terlindungi.', 'true', 1, NULL, '2021-07-10 05:51:48'),
(164, 'Juga ngak perlu takut ataupun ragu, segera lakukan vaksinasi COVID-19 di faskes maupun sentra vaksinasi terdekat di kotamu.\r\n\r\nJangan lupa ajak dan dampingi orang tua ataupun anggota keluargamu yang berusia lanjut untuk mendapatkan vaksinasi ya.', 'true', 1, NULL, '2021-07-10 05:51:49'),
(165, 'Vaksin Sinovac telah digunakan di lebih dari 20 negara, pun dengan vaksin lain yang digunakan dalam program vaksinasi nasional COVID-19.\r\n\r\nJadi ngak perlu khawatir ya #Healthies, apalagi pilih-pilih jenis vaksin, karena semua vaksin yg disediakan pemerintah terjamin keamanannya.', 'true', 1, NULL, '2021-07-10 05:51:51'),
(166, 'Riset juga telah membuktikan bahwa vaksin COVID-19 mampu mencegah kematian dan mencegah sakit parah yang berujung perawatan. Selain Sinovac, WHO telah menerbitkan Daftar Penggunaan Darurat (EUL) untuk vaksin AstraZeneca, Pfizer, Moderna dan Sinopharm.', 'true', 1, NULL, '2021-07-10 05:51:52'),
(167, 'Pemerintah Indonesia berkomitmen menyediakan vaksin terbaik untuk melindungi seluruh masyarakat. Oleh karenanya, masyarakat diimbau tidak perlu pilih-pilih vaksin, karena semua jenis vaksin baik untuk mencegah penularan COVID-19 dan telah melalui uji kualitas, keamanan &amp; efikasi.', 'true', 1, NULL, '2021-07-10 05:51:54'),
(168, 'Vaksin COVID-19 produksi Sinovac secara resmi mendapatkan validasi penggunaan darurat (Emergency Use Listing) dari Badan Kesehatan Dunia (WHO) pada Selasa (1/6).\r\n\r\nDengan terbitnya EUL ini membuktikan bahwa vaksin tersebut aman, bermutu &amp; berkhasiat. https://t.co/xNjJZxQjOd', 'true', 1, NULL, '2021-07-10 05:51:55'),
(169, 'Pada pelaksanaanya @KemenkesRI meminta pemda untuk menjalin kerja sama dengan seluruh stakeholder terkait yakni komunitas, organisasi lokal, dan pihak swasta untuk melakukan mobilisasi dan mendaftarkan masyarakat lansia dan penyandang disabilitas ke lokasi vaksinasi COVID-19.', 'true', 1, NULL, '2021-07-10 05:51:57'),
(170, 'Hal ini Sesuai Surat Edaran Menteri Kesehatan No. HK.02.01/MENKES/598/2021 Tentang Percepatan Pelaksanaan Vaksinasi COVID-19 Bagi Masyarakat Lanjut Usia, Penyandang Disabilitas, Serta Pendidik, dan Tenaga Pendidikan.', 'true', 1, NULL, '2021-07-10 05:51:58'),
(171, '#Healthies, @KemenkesRI mulai menyelenggarakan vaksinasi COVID-19 bagi 562.242 penyandang disabilitas fisik maupun psikis di seluruh Indonesia secara bertahap terhitung mulai Selasa (1/6). https://t.co/moGbVdp4WE', 'true', 1, NULL, '2021-07-10 05:51:59'),
(172, '#Healthies, pandemi COVID-19 yang terjadi di seluruh dunia memiliki dampak multisektor.  \r\n\r\nBelajar dari pandemi, yuk kita tumbuhkan semangat dan harapan agar pandemi berakhir, melalui vaksinasi COVID-19 lengkap sesegera mungkin. \r\n\r\nKesehatan pulih, ekonomi bangkit! https://t.co/BU3urV6onl', 'true', 1, NULL, '2021-07-10 05:52:00'),
(173, '#RilisSehat\r\n\r\nMenteri Kesehatan Canangkan Vaksinasi COVID-19 Bagi Kaum Disabilitas @KemenkesRI \r\n\r\nhttps://t.co/SQtMAIQeUs https://t.co/Mmzc0AmFQN', 'true', 1, NULL, '2021-07-10 05:52:01'),
(174, 'Selamat Hari Lahir Pancasila \r\nMari kita implementasikan nilai-nilai Pancasila dengan bersatu, bergotong royong melawan pandemi COVID-19 dengan tetap disiplin menerapkan protokol kesehatan di mana pun dan kapan pun. \r\n\r\nPancasila adalah semangat kita menuju Indonesia tangguh! https://t.co/EbRcAhr8aA', 'true', 1, NULL, '2021-07-10 05:52:02'),
(175, 'Disituasi pandemi, kebiasaan merokok meningkatkan risiko kerentanan terjangkit COVID-19. \r\n\r\nSebab, merokok adalah faktor risiko bagi PTM (diabetes, hipertensi, penyakit jantung, kanker) yang merupakan komorbid COVID-19, jadi bisa menimbulkan keparahan saat terpapar COVID-19. https://t.co/DRXMedgSEH', 'true', 1, NULL, '2021-07-10 05:52:03'),
(176, '#Healthies, vaksinasi Gotong Royong (GR) jadi salah satu cara pemerintah mempercepat cakupan vaksinasi COVID-19. \r\n\r\nVaksinasi GR ditujukan bagi pegawai dan keluarganya di perusahaan swasta. Dan pembiayaannya pun menjadi tanggung jawab perusahaan tersebut. https://t.co/gryODScnhE', 'true', 1, NULL, '2021-07-10 05:52:04'),
(177, 'Selamat Hari Lanjut Usia Nasional\r\n\r\nMemperingati HLUN 2021, @KemenkesRI menggelar Gebyar Vaksinasi Nasional di seluruh Indonesia.\r\n\r\nSebagai anggota keluarga terdekat, mari dampingi &amp; bantu mereka mendapatkan vaksinasi COVID-19 sesegera mungkin\r\n\r\nLansia Bahagia Bersama Keluarga https://t.co/pV22NhmT2G', 'true', 1, NULL, '2021-07-10 05:52:05'),
(178, '#Healthies, vaksinasi COVID-19 memiliki manfaat jauh lebih besar dibandingkan risikonya. \r\n\r\nDengan vaksinasi kita tidak hanya melindungi diri sendiri, tetapi juga ikut membantu melindungi kelompok rentan dan seluruh masyarakat. https://t.co/43X8G8YhPK', 'true', 1, NULL, '2021-07-10 05:52:06'),
(179, 'Sejauh pelaksanaan vaksinasi COVID-19, Komnas KIPI melaporkan belum ada kematian langsung sebagai akibat dari vaksinasi COVID-19. Setelah dilakukan investigasi, kematian orang dengan status telah divaksinasi tidak berkaitan dengan penyuntikan vaksin.', 'true', 1, NULL, '2021-07-10 05:52:07'),
(180, 'Reaksi anafilaktik pasti terjadi pada penyuntikan vaksinasi skala besar meskipun kejadiannya sangat jarang. Dari satu juta dosis, terjadi sebanyak 1 atau 2 kasus. \r\n\r\nHingga kini dilaporkan belum ada kejadian anafilaktik pasca penyuntikan COVID-19 di Indonesia. https://t.co/2mm7VucnUq', 'true', 1, NULL, '2021-07-10 05:52:08'),
(181, 'Menkes menegaskan bahwa pandemi COVID-19 membutuhkan peran dan dukungan dari seluruh komponen bangsa Indonesia. Melalui kolaborasi ini, kita optimis masa sulit ini bisa segera dilewati.', 'true', 1, NULL, '2021-07-10 05:52:09'),
(182, 'DKI Jakarta justru menjadi salah satu daerah dengan cakupan vaksinasi lansia &amp; testing paling tinggi di Indonesia\r\n\r\nMenkes mengapresiasi kerja keras seluruh pihak di DKI Jakarta yg telah berkontribusi dlm percepatan program vaksinasi nasional maupun penanganan pandemi COVID-19', 'true', 1, NULL, '2021-07-10 05:52:10'),
(183, 'Disampaikan bahwa indikator risiko ini dibuat berdasarkan pedoman terbaru WHO\r\n\r\nData &amp; angka yg disajikan hanya diperuntukkan bagi analisa internal @KemenkesRI guna melihat laju penularan &amp; kesiapan daerah dalam merespon penanganan pandemi COVID-19 terutama pasca libur lebaran', 'true', 1, NULL, '2021-07-10 05:52:12'),
(184, '#Healthies, Menteri Kesehatan Budi Gunadi Sadikin meluruskan isu yang berkembang terkait dengan penggunaan indikator risiko yang dinilai sebagai bagian dari penilaian pusat terhadap kinerja daerah dalam menangani pandemi COVID-19. https://t.co/OCJYVYkXfm', 'true', 1, NULL, '2021-07-10 05:52:13'),
(185, 'Perlu diingat bahwa saat ini penularan COVID-19 masih terjadi ditengah masyarakat, untuk itu diimbau agar tetap waspada dengan menerapkan protokol kesehatan 3M, jika memang tidak ada kepentingan sebaiknya #dirumahsaja, dengan tetap melakukan kegiatan yang produktif dan sehat.', 'true', 1, NULL, '2021-07-10 05:52:14'),
(186, 'Apa yang harus dilakukan jika sudah terlanjur mudik dan khawatir terinfeksi COVID-19?\r\n\r\nTetap tenang ya #Healthies, apabila kamu pernah berkumpul di kerumunan sebaiknya segera lakukan Rapid Test Antigen atau Swab PCR. https://t.co/jLNXgk1b6J', 'true', 1, NULL, '2021-07-10 05:52:15'),
(187, '#Healthies, mengantisipasi lonjakan kasus terkonfirmasi serta penyebaran varian baru COVID-19, @KemenkesRI mendorong daerah untuk menggencarkan 3T (Testing, Tracing dan Treatment), supaya bisa segera dilakukan tindakan penanganan.', 'true', 1, NULL, '2021-07-10 05:52:16'),
(188, 'Saat di tempat umum seperti moda transportasi maupun di ruangan tertutup, sebaiknya tingkatkan kewaspadaan terhadap penularan COVID-19 dengan tidak melakukan interaksi langsung kepada orang lain. https://t.co/7ffHF948bD', 'true', 1, NULL, '2021-07-10 05:52:17'),
(189, 'Hai #Healthies!\r\n\r\nTahulah kamu, hasil pemeriksaan negatif COVID-19 tidak menjamin kamu kebal terhadap COVID-19 lho. Sebab, kemungkinan kamu terpapar COVID-19 masih sangat besar terlebih jika kamu abai terhadap protokol kesehatan 3M. https://t.co/TrxmKBFjSy', 'true', 1, NULL, '2021-07-10 05:52:18'),
(190, 'Sudah divaksinasi lengkap masih bisa terinfeksi COVID-19?\r\n\r\n#Healthies, vaksinasi tidak menjamin 100% terhindar dari penularan COVID-19. Namun dengan vaksinasi, kita mengurangi gejala berat yang timbul saat terpapar COVID-19, sehingga gejalanya jauh lebih ringan. https://t.co/xgPKZl67bo', 'true', 1, NULL, '2021-07-10 05:52:19'),
(191, 'Jadi jangan lengah ya #Healthies, selalu terapkan protokol kesehatan disetiap aktivitasmu dengan disiplin memakai masker, mencuci tangan pakai sabun &amp; menjaga jarak aman dengan orang lain.\r\n\r\nKebiasaan baik ini adalah kunci utama terhindar dari penularan COVID-19.\r\n\r\nSalam sehat!', 'true', 1, NULL, '2021-07-10 05:52:20'),
(192, 'Sebab, kita tidak pernah tahu siapa yg sakit &amp; sehat. Karena dari data yang dihimpun, dari 6-7 orang yg berkumpul 1 diantaranya positif COVID-19 tanpa memiliki gejala apapun, sehingga yang bersangkutan merasa baik-baik saja, inilah yg menjadi risiko terbesar dari sumber penularan https://t.co/AuCFhjjb9t', 'true', 1, NULL, '2021-07-10 05:52:21'),
(193, '#Healthies, tahukah kamu berkerumun di manapun memiliki risiko besar tertular COVID-19 lho. \r\n\r\n#BersatuLawanCovid19 https://t.co/ZAKRQevqkI', 'true', 1, NULL, '2021-07-10 05:52:22'),
(194, 'Manfaat vaksin dalam penanganan COVID-19 lebih besar daripada risiko efek sampingnya (yang dapat mengakibatkan masalah pembekuan darah atau reaksi KIPI lainnya), tidak ada permasalahan terkait kualitas vaksin COVID-19 AstraZeneca. https://t.co/Ds55LYUEl2', 'true', 1, NULL, '2021-07-10 05:52:23'),
(195, 'Hai #Healthies, tahukah kamu vaksin AstraZeneca merupakan salah satu vaksin COVID-19 yang efektif menangkal varian baru COVID-19 lho.\r\n\r\nHal ini berdasarkan penelitian cepat yang dilakukan oleh Publik Health England (PHE) pada 5 April hingga 16 Mei 2021. https://t.co/QGdduTEOUQ', 'true', 1, NULL, '2021-07-10 05:52:25'),
(196, 'Vaksinasi ini berlaku bagi masyarakat KTP DKI maupun Non DKI Jakarta. Jadi tunggu apalagi, yuk pastikan orang tua atau anggota keluargamu segera mendapatkan vaksinasi COVID-19 ya \r\n\r\nSalam sehat!', 'true', 1, NULL, '2021-07-10 05:52:26'),
(197, '#Healthies, apakah kamu memiliki anggota keluarga berusia diatas 50 tahun? \r\n\r\nYuk saatnya bantu &amp; dampingi mereka untuk mendapatkan vaksinasi COVID-19 di BBPK Hang Jebat Jakarta. \r\n\r\nCaranya harus mendaftar terlebih dahulu melalui https://t.co/Tkcng3ZYUx di https://t.co/MLdGfrAhx3 https://t.co/ZLeB3FpZqh', 'true', 1, NULL, '2021-07-10 05:52:27'),
(198, 'Pandemi COVID-19 telah berdampak secara multidimensional, salah satunya sektor pariwisata\r\n\r\nBelajar dari pandemi, bersama kita cegah penularan COVID-19 dengan disiplin prokes 3M &amp; menggencarkan vaksinasi untuk menghentikan penyebaran virus &amp; memastikan pemulihan ekonomi yang cepat https://t.co/AZdxlBJqc5', 'true', 1, NULL, '2021-07-10 05:52:28'),
(199, 'Dengan adanya penetapan ini, merupakan upaya Kementerian Kesehatan untuk menjamin lab pemeriksaan COVID-19 memiliki standar dan bekerja dalam kapasitas maksimal, sehingga didapatkan hasil pemeriksaan spesimen COVID-19 yang cepat dan valid.', 'true', 1, NULL, '2021-07-10 05:52:29'),
(200, 'Lab yang telah memenuhi persyaratan harus memberitahukan kesiapan untuk pemeriksaan COVID-19 kepada dinkes provinsi untuk dilakukan penilaian dengan tembusan dinkes kabupaten/kota\r\n\r\nSembilan jenis Lab itu harus mencakup Lab rujukan nasional, Lab Pembina provinsi &amp; Lab pemeriksa.', 'true', 1, NULL, '2021-07-10 05:52:30'),
(201, 'Keputusan ini tertuang dalam Keputusan Menteri Kesehatan nomor HK.01.07/MENKES/4642/2021 tentang Penyelenggaraan Laboratorium Pemeriksaan COVID-19, yang ditetapkan pada 11 Mei 2021.', 'true', 1, NULL, '2021-07-10 05:52:31'),
(202, 'Menteri Kesehatan Budi Gunadi Sadikin menetapkan 9 jenis laboratorium pemeriksaan COVID-19\r\n\r\nPenguatan jejaring lab menjadi bagian penting untuk mempercepat proses pengujian tentunya sesuai pedoman WHO, yg mana pedoman itu terus berkembang seiring dengan persebaran virus tersebut. https://t.co/cIhbTCXsvs', 'true', 1, NULL, '2021-07-10 05:52:33'),
(203, '#Healthies, vaksinasi COVID-19 tahap ketiga yang menyasar kelompok masyarakat rentan yang tinggal di daerah zona penularan tinggi (zona merah) telah resmi dimulai dari DKI Jakarta dan secara bertahap akan dilaksanakan di seluruh Indonesia. https://t.co/CmxAQlCIsq', 'true', 1, NULL, '2021-07-10 05:52:34'),
(204, '#RilisSehat\r\n\r\nCara Efektif Cegah Penularan COVID-19 : Pemeriksaan, Pelacakan, Karantina, dan Isolasi @KemenkesRI \r\n\r\nhttps://t.co/QVmnT9FDSd', 'true', 1, NULL, '2021-07-10 05:52:35'),
(205, 'Hingga kini berdasarkan data Komnas KIPI belum pernah ada kejadian orang yg meninggal dunia akibat vaksinasi COVID-19 di Indonesia. Beberapa kasus sebelumnya, meninggalnya orang yg statusnya telah divaksinasi karena penyebab lain, bukan akibat dari vaksinasi yg diterimanya.', 'true', 1, NULL, '2021-07-10 05:52:36'),
(206, 'Manfaat vaksinasi jauh lebih besar jika dibandingkan risiko kematian yang akan terjadi akibat penyakit COVID-19. Oleh karenanya vaksinasi COVID-19 menggunakan vaksin AstraZeneca akan terus berjalan. https://t.co/VkXCOtmo10', 'true', 1, NULL, '2021-07-10 05:52:37'),
(207, 'Beberapa negara di Eropa melaporkan terjadi penurunan angka infeksi, angka rawat inap, dan angka kematian yang signifikan pasca vaksinasi COVID-19, termasuk penggunaan vaksin AstraZeneca.', 'true', 1, NULL, '2021-07-10 05:52:39'),
(208, '#Healthies, vaksin COVID-19 produksi AstraZeneca terbukti aman dan berkhasiat melindungi orang dari risiko COVID-19 yang sangat serius, termasuk kematian, rawat inap, dan penyakit parah. \r\n\r\nHingga kini, 1 miliar dosis vaksin COVID-19 AstraZeneca telah diterima masyarakat dunia. https://t.co/K6VEpDMKWx', 'true', 1, NULL, '2021-07-10 05:52:40'),
(209, 'Pada pelaksanaannya vaksinasi Gotong Royong akan diserahkan kepada pihak swasta dan tidak boleh dilakukan di fasyankes milik pemerintah, sehingga tidak akan menganggu jalannya program vaksinasi nasional COVID-19 pemerintah.', 'true', 1, NULL, '2021-07-10 05:52:41'),
(210, 'Ketentuan ini tertuang dalam Peraturan Menteri Kesehatan Nomor 10 Tahun 2021 tentang Pelaksanaan Vaksinasi Dalam Rangka Penanggulangan Pandemi Corona Virus Disease 2019 (COVID-19) yang ditetapkan pada tanggal 24 Februari 2021.', 'true', 1, NULL, '2021-07-10 05:52:42'),
(211, '#Healthies, untuk mempercepat sekaligus memperluas cakupan vaksinasi COVID-19 agar segera tercapai kekebalan kelompok, pemerintah secara resmi mengizinkan pelaksanaan vaksinasi gotong royong mulai Selasa (18/5). https://t.co/fzBieHDiv2', 'true', 1, NULL, '2021-07-10 05:52:43'),
(212, 'Pandemi tidak menyurutkan semangat anak bangsa untuk tetap belajar, dengan adanya program mengajar dari rumah ini sangat mempermudah para siswa untuk tetap menerima pengajaran dari  relawan. #diktimengajardarirumah\r\n#diktidutaedukasiperubahanperilaku @ditjendikti @satgascovid19id https://t.co/Y5ezZQlxo9', 'true', 1, NULL, '2021-07-10 05:52:44'),
(213, 'Belajar dari rumah merupakan bagian dari mencegah menyebaran covid-19.\r\n@satgascovid19id \r\n@bppPDN_official \r\n@satgasperubahanperilaku\r\n#diktimengajardarirumah\r\n#diktidutaedukasiperubahanperilaku https://t.co/KS1NLXNgIa', 'true', 1, NULL, '2021-07-10 05:52:45'),
(214, 'Dengan mengajar di rumah kita bisa lebih hati-hati dan waspada dari tertularnya wabah covid-19.\r\n#DiktiMengajarDariRumah\r\n#DiktiDutaEdukasiPerubahanPerilaku\r\n@ditjendikti @PermadaniDiksi @satgascovid19id https://t.co/qNKwMSMYij', 'true', 1, NULL, '2021-07-10 05:52:45'),
(215, 'Jangan lupa pakai masker\r\n@satgascovid19id \r\n@Diktimengajardarirumah\r\n@Diktidutaedukasiperubahanperilaku https://t.co/Avamv2gWLi', 'true', 1, NULL, '2021-07-10 05:52:46'),
(216, 'Pandemi tidak menghalangi untuk tetap belajar. \r\n@satgascovid19id \r\n@bppPDN_official \r\n#DiktiDutaEdukasiPerubahanPrilaku \r\n#diktimengajardarirumah https://t.co/SwQ8kXqVC6', 'true', 1, NULL, '2021-07-10 05:52:47'),
(217, 'covid-19 bukan alasan untuk bermalas-malasan mari belajar bersama2 dengan tetap mematuhi protokol kesehatan\r\n\r\n#diktimengajardarirumah \r\n#diktidutaedukasiperubahanprilaku \r\n@PermadaniDiksi\r\n@satgascovid19id\r\n@ditjendikti https://t.co/d25lw5obqY', 'true', 1, NULL, '2021-07-10 05:52:48'),
(218, 'Sekarang membiasakan diri mencuci tangan dengan sabun dan air mengalir ini penting dilakukan. Ini yang akan jadi kunci untuk membunuh, merusak, dan mematikan virus yang mencemari tangan kita\r\n\r\n#DiktiMengajarDariRumah \r\n#DiktiDutaEdukasiPerubahanPrilaku \r\n@satgascovid19id https://t.co/sk6X1r0Fez', 'true', 1, NULL, '2021-07-10 05:52:49'),
