INSERT INTO `tweepy_raw` (`id_raw_data`, `text`, `label`, `cleaned`, `created_at`, `updated_at`) VALUES
(264, 'Menteri BUMN, Erick Thohir perluas sentra Vaksinasi di Tanah Air. Kali ini di Polonia, Medan. Pandemi belum berakhir, untuk itu masyarakat harus mendukung pemerintah @jokowi Lawan Pandemi https://t.co/zwq9sDP8Px', 'true', 1, NULL, '2021-07-10 05:53:16'),
(265, 'HORAS! Sentra Vaksinasi Bersama Kini Hadir di Kota Medan, Ayo Vaksin! - #INDONESIA https://t.co/h6kvxFGrwc', 'true', 1, NULL, '2021-07-10 05:53:16'),
(266, 'SENTRA VAKSINASI BERSAMA BUMN HADIR DI MEDAN! Ayo segera daftarkan diri dan buat janji melalui aplikasi Halodoc atau klik link https://t.co/tTGAvtNDlS', 'true', 1, NULL, '2021-07-10 05:53:17'),
(267, 'Kebut Vaksinasi COVID-19, Kemenkes: Perluas Pos Pelayanan Dan Menghapus Syarat KTP Domisili https://t.co/UwYSzhAryn', 'true', 1, NULL, '2021-07-10 05:53:18'),
(268, 'Akselerasi Vaksinasi harus ditingkatkan dan saat ini Pemerintah memutuskan untuk menghapus syarat KTP domisili bagi peserta vaksinasi. https://t.co/iKkKNw54j7', 'true', 1, NULL, '2021-07-10 05:53:19'),
(269, 'Permenkes Nomor 18/2021 menyatakan, pemerintah juga bertanggung jawab dalam membiayai penanganan KIPI.\r\nhttps://t.co/7lvvqb6e3d', 'true', 1, NULL, '2021-07-10 05:53:20'),
(272, 'Kemenkes Siapkan Vaksinasi Anak: Lokasi, Aturan Skrining, hingga Penanganan KIPI  Kumparan https://t.co/a5xGDwR7MM', 'true', 1, NULL, '2021-07-10 19:22:18'),
(302, 'memakan makanan dengan kandungan vit c dapat meningkatkan sistem imun tubuh untuk mencegah terkena covid-19', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:40'),
(303, 'jeruk dapat membantu menigkatkan kekebalan tubuh untuk menangkal covid-19', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:41'),
(304, 'Kepala BPOM, Penny K Lukito, menyebutkn penerbitan EUA utk vaksin Moderna telah mempertimbangkan hasil kajian dari Tim Ahli Komite Nasional Penilai Vaksin COVID-19 &amp; Komite Penasihat Ahli Imunisasi Nasional atau Indonesian Technical Advisory Group on Immunization.#StayFitForLife https://t.co/m4PGNDw2l6', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:44'),
(305, 'Badan POM mengeluarkan izin penggunaan darurat atau Emergency Use Authorization (EUA) untuk Vaksin COVID-19 Moderna.\n\n#KPCPEN #PusatInformasiPCPEN #Moderna #Vaksin https://t.co/JKpShaE0lV', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:45'),
(306, '2 Juli 2021, BPOM terbitkan izin penggunaan darurat / Emergency Use Authorization (EUA) untuk Vaksin COVID-19 Moderna. Hal ini melengkapi EUA yang telah diberikan kepada 4 jenis vaksin lainnya yang digunakan di Indonesia yaitu: CoronaVac, Sinovac AstraZeneca , dan Sinopharm.', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:47'),
(307, 'Badan POM telah menerbitkan izin penggunaan ruang darurat atau Emergency Use Authorization (EUA) untuk vaksinnasi COVID-19. https://t.co/cd58Bx5VvI', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:48'),
(308, 'BPOM: Lima Vaksin COVID-19 Dapat EUA, Ini yang Dibolehkan untuk Anak Usia 12 Hingga 17 Tahun  https://t.co/pZcreM2Uld #VaksinCOVID19 #VaksinAnak #Sinovac #BioFarma #AstraZeneca #Sinopharm #Moderna #BPOM', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:49'),
(309, 'Badan Pengawas Obat dan Makanan (BPOM) telah memberikan izin penggunaan darurat (EUA) pada vaksin Corona Moderna pada Jumat (2/7). Efikasi vaksin ini disebutkan mencapai 94,1 persen untuk usia di atas 18 hingga 65 tahun.\nhttps://t.co/Xz6QiytXpy', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:51'),
(310, 'Moderna merupakan vaksin mRNA yang memerlukan teknologi penyimpanan berbeda dari jenis vaksin dari platform inactivated virus yang sebelumnya telah memperoleh EUA. Vaksin ini perlu sarana penyimpanan pada suhu minus 20 derajat Celsius .', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:52'),
(311, 'Vaksin Moderna merupakan vaksin pertama dari pengembangan menggunakan platform mRNA yang memperoleh EUA dari Badan POM. Vaksin ini merupakan bantuan dari Pemerintah Amerika yang disalurkan melalui skema COVAX facility.', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:54'),
(312, 'By the way vaksin yang baru keluar EUA nya dari Moderna, nilai efikasi terlampir (efikasi dan efisiensi hal yang beda ya, efikasi tinggi atau rendah gak mencerminkan efisiensi karena efisiensi keluar angka setelah semua uji klinis selesai) https://t.co/ZLB2yt6p7M', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:55'),
(313, 'BPOM Terbitkan Izin EUA Vaksin Covid-19 Moderna untuk Usia 18-65 tahun https://t.co/GOOlw4r7fF @BPOM_RI @KemenkesRI @BNPB_Indonesia', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:56'),
(314, 'Kali ini, Vaksin COVID-19 Moderna yang disetujui penggunaan daruratnya oleh Badan POM pada hari Kamis (01/07/2021).\n\nVaksin ini merupakan vaksin pertama dari pengembangan vaksin yang menggunakan platform mRNA yang memperoleh EUA dari Badan POM.', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:57'),
(315, 'Moderna COVID-19 Vaccine merupakan vaksin pertama dengan platform mRNA yang mendapat EUA Badan POM. Vaksin ini harus disimpan dalam suhu -20 Celcius dan dijaga keamanannya', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:14:59'),
(316, 'Moderna COVID-19 Vaccine merupakan vaksin pertama dengan platform mRNA yang mendapat EUA Badan POM. Vaksin ini harus disimpan dalam suhu -20 Celcius dan dijaga keamanannya', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:15:00'),
(317, 'Kepala BPOM Penny Lukito mengumumkan penerbitan izin penggunaan darurat atau Emergency Use Authorization (EUA) untuk vaksin Covid-19 Moderna. Hal tersebut disampaikan dalam konferensi pers virtual, Jumat (2/7). (Ref) #ElshintaEdisiMalam https://t.co/GoSwVILzuV', 'true', 1, '2021-07-14 01:06:53', '2021-07-14 01:15:02'),
