(395, 'Kalo takut vaksin karena bikin mati, coba ajak konsul ke dokter, lebih bagus ke dokter yg biasa kontrol, ajak diskusi sama dokter jadi ajakan bukan kata kita lg', 'fake', 1, '2021-07-14 01:08:02', '2021-07-14 01:16:19'),
(396, 'Takut vaksin karena bisa bikin mati.', 'fake', 1, '2021-07-14 01:08:02', '2021-07-14 01:16:20'),
(397, 'Setelah dinyatakan reaktif pasca vaksin, gw cuma anggap covid-19 itu cuma flu biasa dgn sedikit efek samping. Itu yg bikin gw ga ada perasaan takut mati.\nYg perlu gw lakuin sekarang adalah #dirumahaja sambil menjaga mulut ini agar tidak selalu terbuka saat bertemu orang lain.', 'fake', 1, '2021-07-14 01:08:03', '2021-07-14 01:16:21'),
(398, 'gamau vaksin krn takut setelah vaksin penyakit bawaannya ke trigger buat muncul &amp; bikin mati. ', 'fake', 1, '2021-07-14 01:08:03', '2021-07-14 01:16:22'),
(399, 'vaksin sinovac mematikan syaraf sel otak, jangan vaksinasi', 'fake', 1, '2021-07-14 01:08:03', '2021-07-14 01:16:23'),
(400, 'Vaksin AstraZeneca Diklaim Mampu Melindungi Hingga 92 Persen, Begini Penjelasannya\n \nhttps://t.co/s7IKPbhflx via @tribuntimur', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:24'),
(401, 'Kenapa Harus Di-Vaksin ? Karena dengan di vaksin kita bisa mendungi diri dan orang-orang di sekitar kita', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:25'),
(402, 'Para peneliti di Skotlandia sebelumnya menemukan bahwa vaksin Pfizer mampu melindungi tubuh dari infeksi COVID-19 sebanyak  92 persen terhadap varian alfa dan 79 persen terhadap delta satu 14 hari setelah dosis kedua. https://t.co/2ivPijvTx1', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:26'),
(403, 'Otoritas kesehatan di Inggris nih juga mengatakan bahwa kedua vaksin tersebut mampu melindungi tubuh dari infeksi seluruhnya. Vaksin Pfizer disebut 96 persen efektif setelah dua dosis, sedangkan suntikan AstraZeneca keefektifannya sebesar 92 persen. https://t.co/GLoF4swnWm', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:27'),
(404, 'Vaksin aztrazeneca n phizer mampu melindungi kita dari virus covid varian delta.Studi di Inggris mengungkapkan hal itu.Terbaik https://t.co/5VdF92jXWR', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:28'),
(405, 'Oleh Pemetintah, dan sudah di gunakan oleh Masyarakat yang SADAR akan manfaat nya. Karena memang semua jenis Vaksin tersebut mampu menangkal bahaya dari pada Virus Corona\n\nTetapi diantara Vaksin yg sudah ada, di temukan salah satu jenis Vaksin yang lebih efektif untuk melindungi https://t.co/P0VgwCLfka', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:29'),
(406, 'WHO: Semua Vaksin yang Terdaftar UEA Melindungi dari Varian Delta, Termasuk Sinovac? https://t.co/xObNjXmCE4', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:30'),
(407, 'Vaksin diperlukan untuk mencegah jangkitan COVID-19 daripada terus merebak dan melindungi kumpulan berisiko tinggi.\nVaksin hanya berkesan jika lebih ramai mengambilnya untuk membentuk imuniti berkelompok.\n\n@MuhyiddinYassin \n#LindungDiriLindungSemua \n#MenangBersama \n#DemiRakyat https://t.co/rw9p7ahotZ', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:31'),
(408, '@kresnosamudro Wkwwkwk\nYa emang vaksin ini ga bisa melindungi 100%, ga semua orang antibodi e bisa lgsg kebentuk.\nTapi yg jelas kita tetep dapet manfaatnya, salah satunya ya ngurangin tingkat keparahan penyakit.', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:32'),
(409, 'WHO: Semua Vaksin yang Terdaftar UEA Melindungi dari Varian Delta https://t.co/XwdtnyP7ak', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:33'),
(410, 'Vaksinasi juga dapat membantu menurunkan risiko penularan virus dan dapat melindungi dan membantu tenaga kesehatan.\nKedua vaksin yang beredar pasti aman dan telah melalui beragam proses seleksi.', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:34'),
(411, 'Yuk Vaksin Untuk Melindungi Diri,sahabat, dan keluarga\n\n#vaksingratis https://t.co/UqL78eCZBC', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:34'),
(412, '@Prehanta @FaheemYounus bkn begitu pak. beberapa olahan yg dilabeli obat covid atau meningkatkan kekebalan mmg belum ada yg teruji secara ilmiah, juga belum ada yg di rekom oleh WHO. Nah kalo masker itu udh jelas melindungi dari droplet, vaksin sdh jelas membentuk kekebalan sekunder', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:36'),
(413, 'negara senantiasa melindungi tumpah darahnya, vaksin merupakan salah satu usahanya, mari kita dukung program vaksinasi  #DisiplinPatuhiPPKM Vaksinasi Cegah Pandemi PPKM Atasi Covid https://t.co/OzjVhmvKRF', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:37'),
(414, 'Pemerintah telah berupaya keras melindungi masyarakat dari pandemi Covid-19, dengan program vaksinasi. Oleh karena itu, masyarakat harus diliterasi terkait komitmen Pemerintah dalam menjamin keamanan dan standar vaksin Covid-19. https://t.co/MiiyMPl5LJ', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:38'),
(415, 'Yuk Vaksin Untuk Melindungi Diri dan Sesama\n\n#vaksingratis https://t.co/ASqlH6zH3c', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:39'),
(416, 'Ayo Vaksin !!!\nVaksin Aman dan melindungi kita semua\n#PPKMDarurat #PPKMDaruratLindungiNKRI \n\n===========================\nPosko Bantuan Penanganan Covid-19 #BersamaUntukWarga\nHp. 081234560390 https://t.co/SHaX2chJGk', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:40'),
(417, 'Hari ini 2 tempat dekat kantor ada vaksinasi besar besaran, so heartwarming lihat orang orang excited vaksin. Semoga sehat selalu semuanya dan jadi ikhtiar untuk melindungi kita bersama', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:41'),
(418, 'Warga perlu tahu ni, kalo setelah kita divaksin tuh membutuhkan cukup waktu lama untuk memberikan kekebalan.\n\nVaksinasi juga berarti kita jauh lebih kecil kemungkinan untuk sakit. Tapi kita juga harus melindungi orang lain pas mereka menunggu giliran untuk nerima vaksin.', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:42'),
(419, 'Sekarang udah kebukti, masih aja nyari kebenaran konspirasi.\n.\nSuka heran emg paling gampang nunjuk orang lain daripada beraksi untuk inropeksi diri.\n.\nYu yang cerdas vaksin yu. Dengan vaksin kalian gacuma melindungi diri kalian, tp juga orang orang disekitar kalian:)', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:43'),
(420, 'Buat temen\" yg punya kesempatan buat vaksin jangan dilewatin. Vaksin memang ga melindungi kita sepenuhnya untuk ga kena covid, tapi mencegah kita bergejala berat, ke rs, atau masuk icu kalo kena. Bentuk ikhtiar kita buat bertahan di pandemi ini.', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:44'),
(421, 'Mari bersama vaksinkan diri ! \n.\nJom Vaksin, imuniti melindungi komuniti! \n.\n\n#jomvaksin \n#kitamestimenang\n#ismakualalumpur #ismaKL https://t.co/yn6cjyDck4', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:46'),
(422, 'Semua orang perlu mengambil vaksin untuk melindungi diri daripada COVID-19. Ini termasuklah golongan ibu yang mengandung. Bagi ibu mengandung yang akan pergi ke PPV mengambil vaksin, anda digalakkan untuk membawa buku merah jambu.\n\nBersama kita hentikan wabak COVID-19. https://t.co/84mOA0F0Ux', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:47'),
(423, 'Ayo Bro &amp; Sis, segera ambil kesempatan vaksinasi yang tersedia. Dengan vaksinasi, kita melindungi diri sendiri dan juga orang lain di sekitar kita.\n\nKader PSI Tangsel sudah vaksin, ambil giliranmu!\n\n#AyoVaksinasi https://t.co/qa53vNiEfo', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:48'),
(424, 'Konsep imunisasi adalah melindungi diri, keluarga dan masyarakat dari penyakit-penyakit berjangkit. Apabila kita mengambil vaksin, diri kita akan dilindungi (kemudian bertawakallah kepada Allah) dari wabak penyakit. Mekanisma pencegahan vaksin COVID-19 ini, https://t.co/A0AoFnVtBH', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:49'),
(425, 'Vaksin tdk membunuh virus, virus itu msih ttp bnyk didlam sna. Tpi vaksin membantu melindungi klian dr mengembangnya gejala prah dr virus itu jd klian gk bkal mati. Itu jg mengurangi resiko klian menyebarkan virus itu jd org lain gk bkal terkena &amp; mati. Terpikirkan oleh klian gk?', 'true', 1, '2021-07-14 01:14:20', '2021-07-14 01:16:50'),
