(500, 'Kakanwil Lakukan Koordinasi Kepada Dinas Kesehatan Provinsi Terkait Vaksinasi 22 Juli 2021 Terhadap 469 ASN, 47 PPNPN, 16.424 WBP, dan 175 Deteni pada Jum\'at, 16 Juli 20201 https://t.co/Jfn3PtxJAl', 'true', 1, '2021-07-17 03:23:20', '2021-07-16 20:39:40'),
(501, 'Presiden menetapkan, tdk ada vaksin berbayar, semua vaksinasi gratis utk rakyat. Sejak awal kebijakannya begitu. Semula ide vaksin berbayar muncul krn ledakan Covid varian Delta. Pemerintah menggencarkan vaksinasi, vaksin ada tp tenaga vaksinator tdk cukup. Terjadi antrean rakyat', 'fake', 1, '2021-07-17 03:23:20', '2021-07-16 20:39:41'),
(502, 'Mohon kepada semua, kes sedang mencanak tinggi. Tolonglah jangan pulang ke kampung. Sabar dulu, kita selesaikan target program vaksinasi kita. Jaga diri, jaga keluarga kamu semua.', 'true', 1, '2021-07-17 03:23:20', '2021-07-16 20:39:42'),
(503, 'Disiplin Protokol Kesehatan dan Vaksinasi Mampu Tanggulangi Pandemi Covid-19. \nPPKM Pulihkan Negeri\nhttps://t.co/I8wbYA1Wa5', 'true', 1, '2021-07-17 03:23:20', '2021-07-16 20:39:43'),
(504, 'Baca The New York Times,IDI, menyatakan bahwa 20 dokter yg meninggal sejak pandemi telah divaksinasi lengkap dengan Sinovac Biotech, vaksin buatan China. Status vaksinasi sebanyak 31 orang lainnya yang meninggal ini sedang diteliti tentang keefektifan Sinovac.', 'fake', 1, '2021-07-17 03:23:20', '2021-07-16 20:39:44');
